import { Text, View, TextInput, TouchableHighlight } from "react-native";

export default function AddNewCourse() {
    return (
        <View style={styles.container}>
            <TextInput style={styles.input} />
            <TextInput style={styles.input} />
            <TextInput style={styles.input} />
            <TouchableHighlight>
                <Text>Submit</Text>
            </TouchableHighlight>
        </View>

    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
    },
    input: {
        width: "100",
        borderWidth: 1,
        margin: 10
    },
    info: {
        marginTop: 20,
    },
    name: {
        fontSize: 24,
    },
    faculty: {
        color: 'grey',
        marginBottom: 5,
    },
    image: {
        width: 100,
        height: 100,
        margin: 20,
    },
    button: {
        borderWidth: 1,
        borderColor: '#0066cc',
        borderRadius: 14,
        paddingHorizontal: 10,
        paddingVertical: 3,
        backgroundColor: '#fff',
        marginTop: 10,
    },
    buttonText: {
        color: '#0066CC',
        fontSize: 12,
        textAlign: 'center',
    },
});
